INSERT INTO `manage_craft_process` VALUES (1,136,33,1,'测试123','测试213','测爱上','love',1,'2024-11-29 15:14:10',1,'2024-12-20 15:49:12',0),(2,135,38,1,'5','1','1','12',1,'2024-11-29 16:41:46',1,'2024-12-23 14:34:41',0),(3,135,37,2,'操作人员应该接受相关的培训，熟悉操作流程和安全注意事项','检查灭活罐的完整性。查看隔离器的外壳是否有损坏、裂缝或泄漏的迹象','准备好需要为灭活罐操作的生物材料','使用无菌工具进行操作，如使用无菌镊子夹取，使用无菌移液管进行液体转移等',1,'2024-11-30 16:57:20',1,'2024-12-22 22:56:01',0),(4,134,40,2,'穿戴适当的个人防护装备，包括防寒手套（最好是厚的、隔热的手套，以防止手部冻伤）、实验服等','准备一个装有干冰或放在低温环境（如 - 20℃冰箱）预冷的保温容器，用于暂时存放从超低温冰箱取出的实验耗材，以保持其低温状态','根据实验耗材的存放记录或预先设定的存放位置，快速定位需要的毒种原料','将装有实验耗材的保温容器尽快转移到实验操作区域',1,'2024-12-03 15:46:57',NULL,NULL,0),(5,134,41,3,'操作人员应该接受相关的培训，熟悉生物隔离器的操作流程和安全注意事项；穿戴适当的个人防护装备','检查生物隔离器的完整性。查看隔离器的外壳是否有损坏、裂缝或泄漏的迹象','对于一些小型的、经过灭菌的物品，如移液管、小瓶等，可以直接通过隔离器上的手套操作孔放入','在隔离器内进行操作时，要严格遵守无菌操作原则',1,'2024-12-03 15:53:48',NULL,NULL,0),(6,140,44,1,'操作人员需要具备扎实的生物化学知识，了解细胞结构、生物分子的性质（如蛋白质、核酸、多糖的理化性质）以及它们在不同环境下的行为','一般转速在 4000 - 10000rpm 之间，适用于较大颗粒（如完整细胞）的初步分离','细胞培养的条件，如培养基成分、培养时间和环境等，会影响原料的质量','在处理多个不同的样品时，要防止生物交叉污染',1,'2024-12-22 22:56:28',1,'2024-12-22 23:02:24',0),(7,140,45,2,'具备扎实生物化学知识、熟练操作技巧、强烈安全意识、敏锐观察力及高效问题解决能力','括合适的层析柱（如离子交换、凝胶过滤等）、精准的泵系统、可靠的检测器及优质的管路阀门','相对稳定的成分与浓度，杂质含量在可控范围，其理化性质适合所选纯化方法，能保证后续纯化的顺利进行和产物质量','稳定的物理环境（温湿度、洁净度适宜）、无化学污染且微生物可控的环境下进行',1,'2024-12-22 22:56:40',1,'2024-12-22 23:06:22',0),(8,140,46,3,'掌握精湛专业知识与技能，有敏锐观察力、精准操作力、良好问题解决力和高度责任心，确保高纯度产物产出','涵盖高分辨率的色谱系统、精准温控及流量控制装置、优质的结晶设备','较高的纯度和稳定性，杂质含量极低，成分明确且均匀，能适应高精度的分离纯化工艺要求','高度洁净，温度、湿度精准稳定，空气无杂质与微生物污染，化学物质残留量低',1,'2024-12-22 22:57:01',1,'2024-12-22 23:09:34',0),(9,140,47,4,'具备深厚专业知识，熟练掌握多种分析技术，有严谨科学态度、精准操作技能及敏锐问题洞察能力','高精度的色谱仪、灵敏的质谱仪、精准的电泳仪等分析仪器，以及配套的可靠数据处理系统和样品前处理设备','能反映产物实际情况，其采集、保存和处理过程规范，确保检测数据准确可靠','恒温恒湿、洁净无尘、无电磁干扰且化学物质挥发少的环境中进行',1,'2024-12-22 22:57:13',1,'2024-12-22 23:12:43',0),(10,134,42,1,'专业培训与资质、操作规范、健康监测','隔离器主体结构、通风与过滤系统、仪器设备兼容性','原料质量控制、灭菌与消毒处理、原料存储与运输','洁净度控制、温湿度调节',1,'2024-12-26 08:55:54',NULL,NULL,0),(11,134,36,4,'专业培训与资质、操作规范、健康监测','隔离器主体结构、通风与过滤系统、配套设备与接口','原料质量、灭菌与预处理、原料存储与传递','洁净度、温湿度与压力、微生物控制',1,'2024-12-26 09:00:53',NULL,NULL,0);
